import { useEffect, useState } from "react";
import { useQuery } from "react-query";
import API from "../API";
// import { SideNavBar, Searchbar } from "../components";

const fetchModel = async () => await API.getViewModel();


function ViewModel() {
const data = useQuery("viewmodel", fetchModel);

  // eslint-disable-next-line react-hooks/exhaustive-deps
  useEffect(async () => {
    API.getViewModel().then((res) => {
      setData(res.data);
    });
    console.log("DATA");
    console.log(data);
  }, []);

  return <div>{data}</div>;
}

export default ViewModel;
